  [],\n\t\"revision_timestamp\": \"2015-12-20T22:32:18.685205\",\n\t\"name\": \"specimen-data-includes-physical-specimens-collection-information-status-storage-locations-and-l\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set includes physical specimens,
  paper logs and Freezerworks database of all logged information on specimens collected
  from Hawaiian monk seals since 1975. Information collected on specimens include
  animal ID's, dates, preservation methods, storage locations, where specimens were
  analyzed, and results of analyses. Specimens collected are either Non-invasive specimens
  \ collected either from dead animals  (e.g.,  tissues, skeletal samples, body fluids,
  etc.) or samples are collected from live animals by collecting scats, molts, spews,
  etc. that are found on the beach near live animals. Invasive specimen collection
  includes tissue plugs collected when animals are tagged, or health screening/survey
  samples that are collected during animal restraint. Samples are collected  by  PSD
  personnel and cooperating scientists as part of the ongoing health and disease,
  population genetics, and foraging ecology assessment. Specimens are housed at PIFSC
  Dole Street office, Kewalo Research Facility, and Ford Island.\",\n\t\"license_title\":
